import React, { useState, useEffect } from 'react';
import axios from 'axios';
function Body() {
    const [movie, setMovie] = useState({ hits: [] });
    useEffect(() => {
        const fetchData = async () => {
            const result = await axios(
                'https://api.themoviedb.org/3/search/movie?query=potter&api_key=4d2868699f6ab95203d92eab296afa21&language=en-US&page=1&include_adult=false',
            );
            //console.log(result.data)
            setMovie(result.movie);
        };
        fetchData();
    }, []);
    return (
        <ul>
            {movie.hits.map(item => (
                <li key={item.title}>
                    <a href={item.url}>{item.title}</a>
                </li>
            ))}
        </ul>
    );
}
export default Body;
